import React from 'react';
// Example sponsors, replace with API data later
const sponsors = [
  { name: 'Sponsor One', logo: '/uploads/sponsor1.png' },
  { name: 'Sponsor Two', logo: '/uploads/sponsor2.png' },
];

const SponsorsGrid = () => (
  <section className="sponsors">
    <h2>Our Sponsors</h2>
    <div className="sponsor-grid">
      {sponsors.map(s => (
        <div className="sponsor-card" key={s.name}>
          <img src={s.logo} alt={s.name} className="sponsor-logo" />
          <span>{s.name}</span>
        </div>
      ))}
    </div>
  </section>
);

export default SponsorsGrid;
